-- Generated from SQLite to PostgreSQL
SET client_encoding = 'UTF8';
SET standard_conforming_strings = on;

-- PostGIS musÌ b˝t vytvo¯eno p¯ed pouûitÌm geom typu
CREATE EXTENSION IF NOT EXISTS postgis;

-- aû potom schÈma a search_path
CREATE SCHEMA IF NOT EXISTS camps_schema;
SET search_path TO camps_schema;

DROP TABLE IF EXISTS camps CASCADE;
CREATE TABLE camps (
  "id" INTEGER,
  "url" TEXT,
  "name" TEXT,
  "image_url" TEXT,
  "lat" DOUBLE PRECISION,
  "lon" DOUBLE PRECISION,
  "operating_time_month_from" INTEGER,
  "operating_time_day_from" INTEGER,
  "operating_time_month_to" INTEGER,
  "operating_time_day_to" INTEGER,
  "web" TEXT,
  "review" TEXT,
  "review_count" INTEGER,
  "price_list_url" TEXT,
  "accept_cards" TEXT,
  "timestamp" TEXT,
  geom public.geometry(Point, 4326)
);


DROP TABLE IF EXISTS sqlite_sequence CASCADE;
CREATE TABLE sqlite_sequence (
  "name" TEXT,
  "seq" TEXT
);


DROP TABLE IF EXISTS equipment CASCADE;
CREATE TABLE equipment (
  "id" INTEGER,
  "name" TEXT,
  "timestamp" TEXT
);


DROP TABLE IF EXISTS camps_equipment CASCADE;
CREATE TABLE camps_equipment (
  "id" INTEGER,
  "camp_id" INTEGER,
  "equipment_id" INTEGER,
  "timestamp" TEXT
);


DROP TABLE IF EXISTS services CASCADE;
CREATE TABLE services (
  "id" INTEGER,
  "name" TEXT,
  "timestamp" TEXT
);


DROP TABLE IF EXISTS camps_services CASCADE;
CREATE TABLE camps_services (
  "id" INTEGER,
  "camp_id" INTEGER,
  "service_id" INTEGER,
  "timestamp" TEXT
);


DROP TABLE IF EXISTS accommodation_types CASCADE;
CREATE TABLE accommodation_types (
  "id" INTEGER,
  "name" TEXT,
  "timestamp" TEXT
);


DROP TABLE IF EXISTS camp_accommodation_types CASCADE;
CREATE TABLE camp_accommodation_types (
  "id" INTEGER,
  "camp_id" INTEGER,
  "accommodation_type_id" INTEGER,
  "timestamp" TEXT
);



-- üó∫Ô∏è P≈ôid√°n√≠ dat do geom sloupce
UPDATE camps
SET geom = public.ST_SetSRID(public.ST_MakePoint(lon, lat), 4326)
WHERE lat IS NOT NULL AND lon IS NOT NULL;